import React from 'react';
import ReactDOM from 'react-dom';

ReactDOM.render( 
    [ 
        <h1> **Order** </h1>, 
        <ul> 
            <li> Coffee </li> 
            <li> Tea </li> 
            <li> Milk </li> 
        </ul>,
     ] , document.getElementById("root"));
